1. Install Rust:
   Follow the instructions on the official Rust website to install Rust: https://www.rust-lang.org/tools/install

2. Create a new Rust project:
   Open a terminal and run the following command to create a new Rust project:

   ```
   cargo new elevenlabs_tts --bin
   ```

3. Add dependencies:
   In the `Cargo.toml` file, add the following dependencies:

   ```toml
   [dependencies]
   reqwest = { version = "0.11", features = ["json"] }
   serde = { version = "1.0", features = ["derive"] }
   serde_json = "1.0"
   clipboard = "3.0"
   tokio = { version = "1.17", features = ["full"] }
   ```

4. Implement the main function:
   Create a new file named `src/main.rs` and add the following code:

   ```rust
   use reqwest::Client;
   use serde::{Deserialize, Serialize};
   use clipboard::ClipboardProvider;
   use std::env;
   use tokio::task::spawn_blocking;

   #[tokio::main]
   async fn main() {
       let api_key = env::var("ELEVEN_LABS_API_KEY").expect("API key not found");
       let clipboard = ClipboardProvider::new().unwrap();
       let text = clipboard.get_contents().unwrap();

       let response = spawn_blocking(move || {
           let client = Client::new();
           let url = "https://api.elevenlabs.io/v1/text-to-speech";
           let data = serde_json::json!({
               "text": text,
               "voice": "en-US-Wavenet-A",
               "format": "mp3"
           });

           let req = client.post(url)
               .header("Authorization", format!("Bearer {}", api_key))
               .json(&data)
               .send()
               .expect("Failed to send request");

           let response = req.json::<Response>().expect("Failed to parse response");

           response.audio
       })
       .await
       .expect("Failed to read audio data");

       // Save the audio data to a file
       let file = std::fs::File::create("output.mp3").expect("Failed to create file");
       let mut file = std::io::BufWriter::new(file);
       response.write_to(&mut file).expect("Failed to write audio data");

       // Play the audio file
       // You can use a third-party library like `rodio` to play the audio file
       // However, playing audio in a console application can be tricky and may require additional setup
       println!("Audio saved to output.mp3");
   }

   #[derive(Serialize, Deserialize, Debug)]
   struct Response {
       audio: Vec<u8>,
       // Other response fields...
   }
   ```

5. Set the API key as an environment variable:
   Set the `ELEVEN_LABS_API_KEY` environment variable with your Eleven Labs API key. You can do this in your shell:

   ```
   export ELEVEN_LABS_API_KEY=your_api_key
   ```

6. Run the application:
   In the terminal, navigate to the project directory and run the following command:

   ```
   cargo run
   ```

Now, when you run the application, it will read the contents of the clipboard aloud using the Eleven Labs API and save the audio to a file named `output.mp3`. You can use a third-party library like `rodio` to play the audio file directly in the console application.

