import UIKit

class StackedLayers {
    private var layers: [CALayer] = []
    private let iconScale: CGFloat = 0.7

    init(images: [UIImage], iconScale: CGFloat = 0.7) {
        self.iconScale = iconScale
        let reversedImages = images.reversed()
        for (index, image) in reversedImages.enumerated() {
            let layer = CALayer()
            let imageView = UIImageView(image: image)
            imageView.contentMode = .scaleAspectFit
            imageView.transform = CGAffineTransform(scaleX: iconScale, y: iconScale)
            imageView.frame = CGRect(x: 0, y: 0, width: image.size.width * iconScale, height: image.size.height * iconScale)
            layer.addSublayer(imageView)
