            } else {
                let newWidth = layer.frame.width
                let iconsSize = CGSize(width: newWidth * iconScale, height: newWidth * iconScale)
                let iconsInset = (newWidth - iconsSize.width) - 1
                layer.frame = CGRect(x: iconsInset, y: iconsInset, width: iconsSize.width, height: iconsSize.height)
            }
        }
    }

    func addToView(view: UIView) {
        for layer in layers {
            view.layer.addSublayer(layer)
        }
    }
